import React from 'react';

const DataProduk = () => {
  return (
    <div style={{ marginLeft: '260px', padding: '20px' }}>
      <h1>Data Produk</h1>
      <p>Halaman ini menampilkan daftar produk yang tersedia.</p>
    </div>
  );
};

export default DataProduk;
